import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Dashboard from './components/Dashboard';
import Register from './components/Register';
import LoanRequest from './components/LoanRequest';
import Payments from './components/Payments';
import AmortizationCalculator from './components/AmortizationCalculator';
import DefaultedLoans from './components/DefaultedLoans';
import LateLoans from './components/LateLoans';
import Users from './components/Users';
import Loan from './components/Loan';

function App() {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <a href="/">Dashboard</a>
            </li>
            <li>
              <a href="/register">Registro de Cliente</a>
            </li>
            <li>
              <a href="/loan-request">Solicitud de Préstamo</a>
            </li>
            <li>
              <a href="/payments">Pagos</a>
            </li>
            <li>
              <a href="/amortization-calculator">Cálculo de Amortización</a>
            </li>
          </ul>
        </nav>

        <Routes>
          <Route path="/" element={<Dashboard />} />
          <Route path="/register" element={<Register />} />
          <Route path="/loan-request" element={<LoanRequest />} />
          <Route path="/payments" element={<Payments />} />
          <Route path="/amortization-calculator" element={<AmortizationCalculator />} />
          <Route path="/defaulted-loans" element={<DefaultedLoans />} />
          <Route path="/late-loans" element={<LateLoans />} />
          <Route path="/users" element={<Users />} />
          <Route path="/loan" element={<Loan />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;


